import React from 'react';
import './Header.css';
import CreateRoomButton from '../containers/CreateRoomButton';
import store from '../store';
const state = store.getState();

export default function Header({ title, room }) {
    return (
        <div id="header">
            HEADER
            {title}
            {room}
            <CreateRoomButton  />
        </div>   
    )
}
